import React from 'react';

const RenderPage = ( props ) => {
  const renderData = ( ) => {
    return props.dataArr && Object.values(props.dataArr).map((el,i) => {
          return (

              <div className="item">
                <div className="content">
                  <span className="header">{ el.movieName }</span>
                  <div className="description">{ el.duration} {el.ratings}</div>
                </div>
              </div>
          );

    })
  }
    return (
      <div>
        <div className="ui list">
          { renderData() }
        </div>
      </div>
    );
}

export default RenderPage;
